import React from "react";
import "./Clock.css";

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      clock: "clock",
    };
  }

  render() {
    return <div className={this.state.clock}></div>;
  }
}

Clock.propTypes = {};
export default Clock;
